import{_ as t,c as r,o as a,V as e}from"./chunks/framework.0e451ef3.js";const p="/Hrsw-Twlog/assets/2023-05-08-6-0.f65efd10.png",s="/Hrsw-Twlog/assets/2023-05-08-7-0.b700f5f7.png",o="/Hrsw-Twlog/assets/2023-05-08-10-0.6e2d3593.png",h="/Hrsw-Twlog/assets/2023-05-08-12-0.54720436.png",i="/Hrsw-Twlog/assets/2023-05-08-13-0.b564b06d.png",d=JSON.parse('{"title":"2023-05-08","description":"","frontmatter":{"title":"2023-05-08T00:00:00.000Z"},"headers":[],"relativePath":"Twitter/2023-05-08.md"}'),n={name:"Twitter/2023-05-08.md"},_=e('<h1 id="_2023-05-08" tabindex="-1">2023-05-08 <a class="header-anchor" href="#_2023-05-08" aria-label="Permalink to &quot;2023-05-08&quot;">​</a></h1><p><a href="https://twitter.com/hirasawa/status/1655558173401686017#m" target="_blank" rel="noreferrer">8 May, 2023 10:00 PM</a></p><p>「知らず」と言っていたのに「忘れられない」というパラドックスはさすがヒラサワの口腔内と、喝采を浴びながら</p><p>またこんど！！</p><hr><p><a href="https://twitter.com/hirasawa/status/1655556907954843648#m" target="_blank" rel="noreferrer">8 May, 2023 09:55 PM</a></p><p>ところで「ばっしらいん」というのは宮古島の方言で「忘れられない」という意味だそうです。</p><p>私の口腔内には今「忘れられない」があります。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655555649504440320#m" target="_blank" rel="noreferrer">8 May, 2023 09:50 PM</a></p><p>抜歯が終わり（へへへ）支払い待ちしていると電話だ。</p><p>「もいもい」「あ、あい、おーえすえ、あい、えーえー」「え！！もうえすか！？あやい！」</p><p>納車の日程が決まったそうです。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655554391062228992#m" target="_blank" rel="noreferrer">8 May, 2023 09:45 PM</a></p><p>それ以来もう痛みは無いのですが、口の中にずっとスライムが有ります。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655553132858859523#m" target="_blank" rel="noreferrer">8 May, 2023 09:40 PM</a></p><p>気のせいでしょうか。</p><p>さっき納豆を食べたら血液が口腔内で凝固し始めました。</p><p>まるでレバ刺しを食べている途中の人のようです。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655551874974531584#m" target="_blank" rel="noreferrer">8 May, 2023 09:35 PM</a></p><p>私だけではありません。 口腔外科の待合室はこんなです。 <img src="'+p+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1655550620399726593#m" target="_blank" rel="noreferrer">8 May, 2023 09:30 PM</a></p><p><img src="'+s+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1655549358128136198#m" target="_blank" rel="noreferrer">8 May, 2023 09:25 PM</a></p><p>現在もやや出血が続いているため唇の周囲や両端にうっすらと赤い血潮がにじんでおります。</p><p>次のTWで自撮りをお見せしましょう。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655548099656568833#m" target="_blank" rel="noreferrer">8 May, 2023 09:20 PM</a></p><p>トロピカルな赤い看板でおなじみの「ばっしらいん」は宮古島のファミレスですが、ピタゴリアンは無理です。どんな店でも逃げ道はありますが「ばっしらいん」では「お冷や」くらいです。</p><p>一方、動物食愛好家は今すぐGo!たとえ現在新橋の飲み屋に向かう山手線のつり革につかまっていようとも。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655546841667338243#m" target="_blank" rel="noreferrer">8 May, 2023 09:15 PM</a></p><p>今は抜糸を待つ抜歯後のラインからまだ出血しています。</p><p>赤いバッシライン。</p><p>（左から、第二大臼歯さん、第一大臼歯さん、第二小臼歯さん） <img src="'+o+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1655545583170625536#m" target="_blank" rel="noreferrer">8 May, 2023 09:10 PM</a></p><p>14年の歳月を経て件の親知らずは本日抜歯されました。</p><p>歯茎を切開されました。</p><p>へへへ。</p><hr><p><a href="https://twitter.com/hirasawa/status/1655544325189582848#m" target="_blank" rel="noreferrer">8 May, 2023 09:05 PM</a></p><p>治療室に入る男の背中を見守る女医さんはこれから男の身に起こる惨事を思い泣いている。</p><p>ヨヨヨと（タイ語で） <img src="'+h+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1655543080479596548#m" target="_blank" rel="noreferrer">8 May, 2023 09:00 PM</a></p><p>2009年？ HKTの歯医者さんで応急処置をしてもらい、先生に「日本に帰ったらすぐにちゃんと治療してください」と言われた親知らず。 <img src="'+i+'" alt="image"></p><hr>',53),m=[_];function l(c,f,w,g,M,u){return a(),r("div",null,m)}const P=t(n,[["render",l]]);export{d as __pageData,P as default};
